Add required dependencies to your Cargo.toml file: [dependencies]
bevy = "0.16"
bevy_northstar = "0.2" The basic requirements to use the crate are to spawn an entity with a Grid component, adjust the points, and then call Grid::build() so the chunk entrances and internal paths can be calculated. To use the built-in pathfinding systems for the crate, insert the NorthstarPlugin specifying the Neighborhood to use. The built-in neighborhoods are: CardinalNeighborhood 4 directions allowing no diagonal movement. CardinalNeighborhood3d 6 directions, including up and down, allowing no diagonal movement. OrdinalNeighborhood 8 directions allowing for diagonal movement. OrdinalNeighborhood3d 26 directions which includes the base ordinal movements and their up/down directions. use bevy::prelude::*;
use bevy_northstar::prelude::*; fn main() { App::new() .add_plugins(DefaultPlugins) // Add the Northstar Plugin with a selected neighborhood to use the built in pathfinding systems .add_plugins(NorthstarPlugin::<CardinalNeighborhood>::default()) .add_systems(Startup, (startup, build_grid.after(startup))) .run();
} fn startup(mut commands: Commands) { commands.spawn(Camera2d::default()); // Spawn the grid used for pathfinding. commands.spawn(Grid<CardinalNeighborhood>::new(&GridSettings { width: 16, height: 16, chunk_size: 4, ..Default::default() }));
} fn build_grid(grid: Single<&mut Grid<CardinalNeighborhood>>) { let mut grid = grid.into_inner(); // Let's set the position 8, 8 to a wall grid.set_point(UVec3::new(8, 8, 0), Point::new(u32::MAX, true)); info!("Building the grid..."); // The grid needs to be built after setting the points. // Building the grid will calculate the chunk entrances and cache internal paths. grid.build(); info!("Grid built successfully!");
}

