Debugging calculated paths for an entity requires you to add a DebugPath component to the entity or entities of your choosing. This component allows you to selectively debug specific paths. Drawing the path gizmos also requires the NorthstarDebugPlugin to add the gizmo drawing system. use bevy::prelude::*;
use bevy_northstar::prelude::*; commands.spawn(( Name::new("Player"), DebugPath { // Width of the tilemap tiles tile_width: 8, // Height of the tilemap tiles tile_height: 8, // Map Type (Square or Isometric) map_type: DebugMapType::Square, // Color of the path gizmos color: Color::srgb(1.0, 0.0, 0.0) },
))

