Enabling the stats feature on the crate will allow the NorthstarPlugin pathfinding systems to calculate how much time is spent per frame on pathfinding and collison. [dependencies]
bevy_northstar = { version = "0.2.0", features = ["stats"]} You can access the statistics from the Stats Resource. fn print_stats(stats: Res<Stats>) { debug!("Collision Stats: {:?}", stats.collision); debug!("Pathfinding Stats: {:?}", stats.pathfinding);
}

