The pathfind system looks for any entity with a Changed Pathfind component. It then runs the pathfinding algorithm and when a valid path is found it will insert the next position in the path as a NextPos component. Consume the NextPos component by handling the movement and then remove the NextPos component. The next_position system will insert a new NextPos component in a later frame. If collision is enabled the next_position system will also handle local collision avoidance and adjust the entities path if there is a blocking entity in the path in the avoidance_distance look ahead set in GridSettings. Example movement system: fn movement( mut commands: Commands, mut query: Query<(Entity, &mut GridPos, &NextPos)>,
) { for (entity, mut grid_pos, next_pos) in query.iter_mut() { // Set the entities GridPos to the NextPos UVec3. grid_pos.0 = next_pos.0; // Update the entities translation let translation = Vec3::new( next.0.x as f32 * 32.0, // Assuming tiles are 32x32 next.0.y as f32 * 32.0, 0.0 ); commands.entity(entity) .insert(Transform::from_translation(translation)) .remove::<NextPos>(); }
}

