PathfindingFailed will inserted into the entity if a path is not found for the desired goal. You can create your own system to handle these failures, or let the built-in system attempt another pathfind for the goal on the next frame. AvoidanceFailed will be inserted when collision is enabled and the entity is not able to path around a local blocking entity. The reroute_path system will attempt to find a new full HPA* path in an attempt to resolve the issue. You can handle these in your own custom system if desired. RerouteFailed is added to the component when all attempts to resolve collision pathing issues have failed and means that there's no viable path at all to the entities desired goal. At this point you will need to handle the issue in your own custom system. Whether this is looking for a new goal or waiting a set amount of time before attempting pathing is up to you. Remove the RerouteFailed component from the entity when the entity is ready to attempt pathfinding again. fn handle_reroute_failed( mut commands: Commands, mut query: Query<(Entity, &Pathfind), With<&RerouteFailed>>,
) { for (entity, pathfind) { let some_new_goal = UVec3::new(3, 30, 0); // Just some random new goal commands .entity(entity) .insert(Pathfind::new(some_new_goal) .remove::<RerouteFailed>(); }
}

